import React from 'react';
import CanvasContainer from './containers/CanvasContainer.js';
import './App.css';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import apiFunctions from './actions/apiFunctions.js';
import pinInput from './components/pins/pinInput.js';

const App = (props) => {
  return (
    <Router>
      {<div className="App">
        <CanvasContainer />
        <Switch>
          <Route path="/maps/:id/pins" render={(props) => fetchPins(props) } />
          <Route path="/maps/:id/" render={(props) => fetchMapInfo(props) } />
          <Route path="/maps/:id/new" component={pinInput} />
        </Switch>
      </div>}
    </Router>
  );
}

export default App;
